"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[5606],{34726:e=>{e.exports=JSON.parse('{"tag":{"label":"source_code","permalink":"/docs/tags/source-code","allTagsPath":"/docs/tags","count":21,"items":[{"id":"associatecodecommits","title":"Associate Code Commits","description":"Create associations between code commits and other Digital.ai TeamForge items, such as tracker artifacts or documents, to help define relationships, track dependencies, and enforce workflow rules.","permalink":"/docs/associatecodecommits"},{"id":"checkcommandhistory","title":"Check Command History","description":"Recent command history for a replica server or a specific repository allows you to check for errors and see whether there are pending commands.","permalink":"/docs/checkcommandhistory"},{"id":"checkoutcode","title":"Check Out Code","description":"You can use the checkout command to check out the code from Subversion or GIT repository.","permalink":"/docs/checkoutcode"},{"id":"codereviewpolicy","title":"Control Your Code Review Policy","description":"You can control all Gerrit Code Review features directly from TeamForge by specifying a code review policy.","permalink":"/docs/codereviewpolicy"},{"id":"createasourcecoderepository","title":"Create a Source Code Repository","description":"Each project can have one or more source code repositories. Before you can create a source code repository, a site administrator must first add one or more SCM servers to the Digital.ai TeamForge environment.","permalink":"/docs/createasourcecoderepository"},{"id":"deletesourcecoderepository","title":"Delete a Source Code Repository","description":"When you delete a repository, a request is submitted to the administrator for approval.","permalink":"/docs/deletesourcecoderepository"},{"id":"getcode","title":"Get the Code","description":"Browse TeamForge to find the code you want to work on, then check out the code.","permalink":"/docs/getcode"},{"id":"import-git-repo","title":"Import External Git Repositories into TeamForge from the Code Browser UI","description":"External public Git repositories can now be imported into TeamForge from the Code Browser UI.","permalink":"/docs/import-git-repo"},{"id":"linkifycustomobjectids","title":"Linkify Custom Object IDs in Code Browser","description":"Include custom object IDs in your commit messages and have them automatically converted to hyperlinks. This is possible if you set up custom object ID mapping for the repository.","permalink":"/docs/linkifycustomobjectids"},{"id":"IntegrationPages/managebinaryrepos","title":"Manage Binary Repositories","description":"With TeamForge\u2014Nexus integration enabled, you can create one or more binary repositories and link them to your project.","permalink":"/docs/IntegrationPages/managebinaryrepos"},{"id":"mass-repo-policy-settings","title":"Mass Configuration of Repository Policies Within a Project","description":"You may often want to apply a specific set of policies to more than one repository. You can just select multiple repositories within a project and apply your policies in one go.","permalink":"/docs/mass-repo-policy-settings"},{"id":"qualitygates","title":"Quality Gates and Review Rules","description":"This topic discusses quality gates and review rules from an administrator perspective. It also discusses some of the known issues with the project level `rules.pl` file and how to work around them.","permalink":"/docs/qualitygates"},{"id":"replicatearepository","title":"Replicate a Subversion Repository","description":"When a Subversion Edge replica has been successfully registered with a TeamForge SCM integration server, it is available to project administrators in projects using that server to house repositories. To replicate a Subversion repository, you need to add it to a replica server.","permalink":"/docs/replicatearepository"},{"id":"pullrequest","title":"Review Code (Gerrit Single-commit and Pull Request Reviews)","description":"TeamForge provides a unified code review experience as it supports both Pull Request and Gerrit single-commit reviews.","permalink":"/docs/pullrequest"},{"id":"searchcode","title":"Search Code","description":"Integration with Black Duck Code Sight (BDCS) is no longer supported in TeamForge 17.1 and later. TeamForge 17.1 (and later) is equipped with its own code search function powered by Elasticsearch. You can do away with BDCS integration while upgrading to TeamForg 17.1 (and later) and set up TeamForge Code Search, which is now one of the integral services of TeamForge. This section discussions the features of TeamForge Code Search and what it takes to set up Code Search on your site.","permalink":"/docs/searchcode"},{"id":"setupgitreplica","title":"Set up Git Replica Servers","description":"On sites distributed across multiple geographic locations, Git Replica Servers are local and remote mirror servers that can provide up-to-date copies of the central repositories. If set up, Git Replica Servers can address load balancing and fetch performance issues. You can set up one or more Git Replica Servers (also referred to as slave or mirror servers) with TeamForge 8.1 and later.","permalink":"/docs/setupgitreplica"},{"id":"setuplfs","title":"Set up LFS","description":"Git Large File Storage (LFS) is a Git extension for versioning large files. Git LFS replaces large files such as audio samples, videos, datasets, and graphics with text pointers inside Git, while storing the file contents on a separate server (typically a remote server).","permalink":"/docs/setuplfs"},{"id":"gitoverview","title":"TeamForge-Git Integration","description":"TeamForge supports integration with Git, a distributed version control tool powered by Gerrit.","permalink":"/docs/gitoverview"},{"id":"userfilterremoval","title":"UserFilter Removal","description":"The `UserFilter` removal from the Quality Gates is a direct outcome of the removal of the `current_user` predicate from the open source Gerrit.","permalink":"/docs/userfilterremoval"},{"id":"viewcodecommits","title":"View Code Commits","description":"To stay up to date with code development on a project, browse the code commits made to each repository integrated into your TeamForge site.","permalink":"/docs/viewcodecommits"},{"id":"internalcodebrowser","title":"Work with the Internal Code Browser","description":"For Subversion and Git repositories, you have the option to use the TeamForge code browser which is turned on by default while integrating the source code server.","permalink":"/docs/internalcodebrowser"}],"unlisted":false}}')}}]);